(29, 958, 19, 'Immunocal Platinum', '1638383839-immunocal-platinum.jpeg', '<p>Venta de caja de immunocal platinum a buen precio.</p>\r\n<p>Tiene todas las ventajas de Immunocal adem&aacute;s de dos componentes adicionales: minerales y creatina, ideal para atletas y personas mayores.</p>\r\n<p><span class=\"a-list-item\">Ayuda a mantener la funci&oacute;n muscular adecuada y la salud &oacute;sea reduciendo la p&eacute;rdida de calcio. *</span></p>', '1800', 0),
