(536, 'joyero-en-puerto-vallarta', 35, 'Joyero en Puerto Vallarta', '', '20 de Noviembre ', 'El Pitillal', 'Puerto Vallarta, Jalisco', '3221099375', '', '3221099375', 'https://ubi-serv.com/', '<p>En taller de joyer&iacute;a en Puerto Vallarta, busca joyero.<br />Con m&aacute;s de 7 a&ntilde;os de experiencia en joyer&iacute;a fina.<br />Manejo de oro y plata para realizar actividades con vaciado.<br />Soldar, pulir, montar piedras, etc&eacute;tera.<br />Cambio de Residencia en Puerto Vallarta.<br />Oferta de tiempo completo.<br />Contrato formal y sueldo de $3500 a la semana.<br />Respeto a la ley laboral de d&iacute;as feriados.<br />Requisitos:<br />Curriculum vitae.<br />INE.<br />Certificado de no antecedentes penales.<br />Fotos de sus trabajos residenciales patronales de sus &uacute;ltimos empleos.<br />Persona responsable de preferencia casada y con familia.</p>\r\n<p><img src=\"https://scontent.fgdl10-1.fna.fbcdn.net/v/t1.6435-9/125973979_3360794390622566_6293339792244050636_n.jpg?_nc_cat=107&amp;ccb=1-3&amp;_nc_sid=8bfeb9&amp;_nc_eui2=AeGr5Mwe8yEEipNModZtV2EnQ_FTSKtJA3VD8VNIq0kDdV8h91sLbjDu7sqp51QNiKnzjOyBU2TIHD3zhZc5LAnk&amp;_nc_ohc=kk15fQHa850AX_DWZHx&amp;_nc_ht=scontent.fgdl10-1.fna&amp;oh=12aafe2b2b6d1158af39527900dda325&amp;oe=60E13497\" alt=\"Puede ser una imagen de ropa de abrigo y texto que dice &quot;Taller de joyeria en Puerto Vallarta busca JOYERO con m&aacute;s de 7 a&ntilde;os de experiencia en joyeria fina manejo de oro y plata para realizar actividades como vaciado soldar pulir montar piedras etcetera cambio de residencia Puerto Vallarta Oferta de tiempo completocontrato formal y sueldo $3500 la semana respeto a la ley laboral d&iacute;as feriados Requisitos: curriculum vitae INE certificado de no antecedentes penales fotos de sus trabajos residencias patronales de sus ultimos empleos oersona responsable de preferencia casada y con familia. Interesados favor de comunicarse con Nicol&aacute;s al 322-109-9375&quot;\" /></p>', '-105.216172860725