(968, 'tortas-los-reyes', 32, 'Tortas los Reyes', '1641237888-tortas.jpg', 'Frontera 5478-5418, Cerro del Cuatro, 45599 San Pedro Tlaquepaque, Jal.', 'Cerro del 4', 'Jalisco', '3321954841', '52', '3321954841', 'https://m.facebook.com/ahogadaslosreyes/photos/a.1718831061510519/3781867758540162/?type=3&_rdr', '<p>Tortas los Reyes</p>', '-103.9690528', '20.5368876', '', '', '', '', 1, '', 1),
(969, 'servicios-especializados-nr', 26, 'Servicios Especializados NR', '1641936430-whatsapp-image-2022-01-11-at-3-23-48-pm.jpeg', ' C. Federico Medrano 151', 'San Juan de Dios II', 'Jalisco', '3328005276', '521', '3328005276', 'https://www.facebook.com/search/top?q=servicio%20nr', '<p>Somos un taller profesional y especializado en cualquier marca de auto.</p>\r\n<p>Reparaci&oacute;n de motores, afinaci&oacute;n, suspensi&oacute;n, cambio de aceites, reparaci&oacute;n de computadoras, programaci&oacute;n de autos, cambio de sensores y mucho m&aacute;s de gasolina o diesel no importa lo que necesites.</p>', '-103.9690528', '20.5368876', '', '', 'https://www.facebook.com/search/top?q=servicio%20nr', '', 1, '', 1),
(970, 'hooligans', 32, 'Hooligans', '1642726820-logo-hooligans.png', 'Adolf Horn #3513, Plaza Regina, Local 2', 'La Unión del Cuatro', 'Jalisco', '3321060852', '521', '3321060852', 'https://ubi-serv.com/servicios/restaurantes/hooligans', '<p style=\"text-align: center;\"><strong>HOOLIGANS TE INVITA</strong></p>\r\n<p>Ven con tus amigos y familia y disfruta de un momento agradable acompa&ntilde;ado de desayunos, botanas, snacks, alitas, Aguachiles, hamburguesas, cerveza y mucho m&aacute;s.</p>\r\n<p><em>&ldquo;La amistad no trata de aquel que llego primero, si no de aquel que lleg&oacute; y nunca se fue&rdquo;.</em></p>\r\n<p><em>Green Street Hooligans</em></p>', '-103.9690528', '20.5368876', '', '', '', '', 1, 'hooligans.pdf', 1),
(971, 'bellabellissimaspa', 38, 'Bella Bellissima Spa', '1650550134-logo-bella.png', 'C. 5 1291-Local 4', ' Colón Industrial', 'Jalisco', '3339013006', '521', '3339013006', 'https://www.facebook.com/anunciafacilmex/posts/3185468965058288', '<p>La belleza es lo primero para lograr tener una mejor autoestima.</p>\r\n<p>Depilaci&oacute;n profesional con l&aacute;ser para cuerpo completo.</p>\r\n<p>Depilaci&oacute;n completa por <strong>$11,999.00</strong> :</p>\r\n<ul>\r\n<li>Axilas</li>\r\n<li>Brazos</li>\r\n<li>Espalda</li>\r\n<li>Abdomen</li>\r\n<li>&Aacute;rea de bikini</li>\r\n<li>Piernas completas</li>\r\n</ul>\r\n<p>No importa si eres hombre o mujer nosotros hacemos que luzcan ambos radiantes.</p>', '-103.9690528', '20.5368876', '', '', 'https://www.facebook.com/anunciafacilmex/posts/3185468965058288', '', 1, '1650550134-folleto.png', 1),
(972, 'chatarreria-electronica', 27, 'Chatarra Electrónica en Guadalajara', '1671725631-logo-prado-01.png', 'Loma Verde no. 400', ' Loma Bonita, 1a Sección', 'Jalisco', '3326415514', '521', '3312892614 ', 'https://chatarraelectronicaguadalajara.com/', '<p>Nos especializamos en la compra de diferentes aparatos el&eacute;ctricos y electr&oacute;nicos. Cualquier aparato o material que genere su negocio o empresa.</p>\r\n<div class=\"elementor-element elementor-element-d84a008 elementor-widget elementor-widget-text-editor\" data-id=\"d84a008\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<p>De igual forma, adquirimos y vendemos servidores electr&oacute;nicos, circuitos integrados, lectores,tarjetas de diferentes clasificaciones, sistemas de seguridad.</p>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-6d77118 elementor-align-center elementor-widget elementor-widget-button\" data-id=\"6d77118\" data-element_type=\"widget\" data-widget_type=\"button.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-button-wrapper\">\r\n<div class=\"elementor-element elementor-element-6b34d6d elementor-widget elementor-widget-text-editor\" data-id=\"6b34d6d\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<p>Compramos y vendemos, perif&eacute;ricos de comunicaci&oacute;n, modems, cpu&acute;s, teclados, altavoces, monitores.</p>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-ef5f84e elementor-align-center elementor-widget elementor-widget-button\" data-id=\"ef5f84e\" data-element_type=\"widget\" data-widget_type=\"button.default\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>', '-103.25331029307073', '20.652852086987593', '', 'https://www.tiktok.com/@pradorecicle', 'https://www.facebook.com/profile.php?id=100070351030192', 'https://www.instagram.com/pradorecicle/', 1